import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class Menu extends Component {



  render() {
    return (
        <div className={"menu"}>
            <div className={this.props.isUXI ? "active" : "inactive"}
            onClick={this.props.isUXI ? this.props.menuPressed : null}>
                Web Dev & Design
            </div>
        </div>
    );
  }
}

export default Menu;
